  return (
    <main>
      <Head>
        <title>AsterElectric | Home</title>
        <meta name="description" content={description}></meta>
      </Head>
      <div className={styles.cont} >
        {/* <Navigation /> */}
        <p className={styles.para}>Hello Next.js</p>
      </div>
      <style jsx>{`
        div{
          // background:red;
